import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './Components/Login';
import Signup from './Components/Signup';
import CaptureImage from './Components/CaptureImage';
import UploadPhoto from './Components/UploadPhoto';
import ProfileSetup from './Components/ProfileSetup';

import './App.css';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Login} />
        <Route path="/register" component={Signup} />  {/* Fixed path */}
        <Route path="/upload-photo" component={UploadPhoto} />  {/* Add route for UploadPhoto */}
        <Route path="/capture-image" component={CaptureImage} /> 
        <Route path="/profile-setup" component={CaptureImage} /> 
      </Switch>
    </Router>
  );
}

export default App;
